  const [Data, setData] = useState("");
  const expenceData = (data) => {
    setData(...data, Data);
    console.log(Data);
  };
  return (
    <div className="App">
      <AddExpences onExpenceData={expenceData} />
      <ListExpences items={Data} />
    </div>
  );
}

export default App;
